ace=\"Tahoma\">Để đảm bảo quyền lợi kh&aacute;ch h&agrave;ng, tr&aacute;nh trường hợp giả mạo, kh&aacute;ch h&agrave;ng cần lưu &yacute; khi nhận phiếu từ Nh&acirc;n vi&ecirc;n giao h&agrave;ng của DHL:</font>\r\n\r\n									<p><font face=\"Tahoma\"><span style=\"padding-right: 10px;\">&bull;</span> Nh&acirc;n vi&ecirc;n giao h&agrave;ng mặc đồng phục DHL (c&oacute; logo DHL)</font></p>\r\n\r\n									<p><font face=\"Tahoma\">Quyền lợi của kh&aacute;ch h&agrave;ng lu&ocirc;n l&agrave; tr&aacute;ch nhiệm của Hotdeal. Hotdeal sẽ kh&ocirc;ng giải quyết bất kỳ khiếu nại n&agrave;o nếu điều kiện tr&ecirc;n kh&ocirc;ng được &aacute;p dụng.</font></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'A', '2020-11-03 03:48:49', '2020-11-06 06:00:46', 1, 'order_create.blade.php'),
(4, 'Đăng ký người dùng', 'C', 'I', '<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background:#ffffff;border: solid 1px #f4f4f4\" width=\"600\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"padding:20px;\">\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>Ch&agrave;o mừng [user.name],</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Cảm ơn qu&yacute; kh&aacute;ch đ&atilde; đăng k&yacute; sử dụng http://hoacudaden.com&nbsp;&ndash; Tại đ&acirc;y qu&yacute; kh&aacute;ch c&oacute; thể mua sắm h&agrave;ng ng&agrave;n sản phẩm lu&ocirc;n được cập nhật mỗi ng&agrave;y, mỗi giờ với gi&aacute; kh&ocirc;ng thể rẻ hơn</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td>TH&Ocirc;NG TIN T&Agrave;I KHOẢN</td>\r\n					</tr>\r\n					<tr>\r\n						<td>+ T&ecirc;n: [user.name]</td>\r\n					</tr>\r\n					<tr>\r\n						<td>+ Email: [user.email]</td>\r\n					</tr>\r\n					<tr>\r\n						<td>+ Điện thoại: [user.phone]</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Bạn cần hỗ trợ ngay? Chỉ cần email <a href=\"mailto:anhdaden@gmail.com\" style=\"\">anhdaden@gmail.com</a> hoặc gọi 1900 6760 (8 -18h từ thứ 2 đến thứ 7). Đội ngũ chăm s&oacute;c kh&aacute;ch h&agrave;ng lu&ocirc;n sẵn s&agrave;ng hỗ trợ qu&yacute; kh&aacute;ch bất cứ l&uacute;c n&agrave;o.</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Tr&acirc;n trọng</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Hoạ Cụ Da Đen</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'A', '2020-11-03 03:58:26', '2020-11-06 06:07:15', 1, NULL),
(5, 'Quên mật khẩu', 'C', 'I', '<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background:#ffffff;border: solid 1px #f4f4f4\" width=\"600\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"padding:20px;\">\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>Ch&agrave;o mừng [user.name],</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Hoacudaden đ&atilde; nhận được y&ecirc;u cầu đặt lại mật khẩu t&agrave;i khoản của qu&yacute; kh&aacute;ch.</td>\r\n					</tr>\r\n					<tr>\r\n						<td><a href=\"[user.url]\">Nhấn v&agrave;o đ&acirc;y để đổi lại mật khẩu</a></td>\r\n					</tr>\r\n					<tr>\r\n						<td>Li&ecirc;n kết n&agrave;y sẽ hết hạn sau 24 giờ kể từ khi email n&agrave;y gửi đi.</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Tr&acirc;n trọng</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td><font color=\"#ff0000\">Hoạ Cụ Da Đen</font></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'A', '2020-11-03 04:01:18', '2020-11-07 08:23:29', 1, NULL);
