(1009, 0, NULL, 'N', 'AL75', 'Áo lưới mặc đi biển 3 màu AL75', NULL, 'ao-luoi-mac-di-bien-3-mau-al75', 'D', '310000.00', '0.00', NULL, 0, NULL, NULL, '&Aacute;o kho&aacute;c dạng chui cổ rộng form d&agrave;i tay d&agrave;i phối 3 m&agrave;u tươi tắn trẻ trung năng động.<br />\r\nNgo&agrave;i việc sử dụng l&agrave;m &aacute;o che ngo&agrave;i khi đi biển, c&ograve;n c&oacute; thể sử dụng l&agrave;m &aacute;o thời trang, phối &aacute;o thun ba lỗ b&ecirc;n trong đảm bảo bạn sẽ rất xinh sắn trong mắt mọi người<br />\r\nChất liệu : Ren cao cấp, mẫu m&atilde; đẹp, sử dụng bền l&acirc;u<br />\r\nXuất xứ : Th&aacute;i Lan<br />\r\nM&agrave;u sắc : Như h&igrave;nh&nbsp;', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
