(1134, 0, NULL, 'N', 'QD104', 'Quần dù couple đi biển QD104', NULL, 'quan-du-couple-di-bien-qd104', 'D', '220000.00', '0.00', NULL, 0, NULL, NULL, '<ul>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Màu sắc : Đen phối tay trắng \">Quần đôi đi biển với họa tiết và màu sắc nổi bật tạo giúp người mặc nổi trội giữa bao người trên bãi biển.<br /></span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Màu sắc : Đen phối tay trắng \">Vải dù cao cấp ,  dày dặn, min, mát, không hút nước , đường may chắc chắn . <br /></span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Màu sắc : Đen phối tay trắng \">Xuất xứ : Made in Việt Nam.</span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Màu sắc : Đen phối tay trắng \">Màu sắc : xanh<br /></span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Màu sắc : Đen phối tay trắng \">Size : Freesize</span></li>\r\n</ul>', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
(1135, 0, NULL, 'N', 'QD92', 'Quần Dù couple đi biển trẻ trung QD92', NULL, 'quan-du-couple-di-bien-tre-trung-qd92', 'D', '220000.00', '0.00', NULL, 0, NULL, NULL, '<p>Quần đôi đi biển với họa tiết và màu sắc nổi bật tạo giúp người mặc nổi trội giữa bao người trên bãi biển.<br />Vải dù cao cấp ,  dày dặn, min, mát, không hút nước , đường may chắc chắn . <br />Xuất xứ : Made in Việt Nam.<br />Màu sắc : xanh.<br />Size: Freesize.</p>', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
(1136, 0, NULL, 'N', 'BKN539', 'Đồ bơi hai mảnh dạng ống nâng ngực BKN539', NULL, 'do-boi-hai-manh-dang-ong-nang-nguc-bkn539', 'D', '320000.00', '0.00', NULL, 0, NULL, NULL, '<ul>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Thiết kế kiểu dáng thể thao với áo croptop cổ tròn, kết hợp với quần short mang đến phong cách khỏe khoắn, năng động.\">Thiết kế kiểu áo croptop cúp ngang trẻ trung năng động, áo có gọng nâng ngực. Quần cạp cao che khuyết điểm vòng 2, vừa sexy nhưng vẫn lịch sự.</span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Thun bơi cao cấp, co dãn 4 chiều, nhập khẩu Hàn Quốc.\">Thun bơi cao cấp, co dãn 4 chiều, nhập khẩu Hàn Quốc.</span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Xuất xứ : Made in Việt Nam.\">Xuất xứ : Made in Việt Nam.</span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Size : M, L, XL.\">Size : Freesize.</span></li>\r\n<li><span id=\"input_part_0\" class=\"\" data-mention=\"Màu sắc : Đen phối tay trắng \">Màu sắc : Xanh dương.</span></li>\r\n</ul>', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
(1137, 0, NULL, 'N', 'AL110', 'Áo lưới đi biển ren trắng nhún eo AL110', NULL, 'ao-luoi-di-bien-ren-trang-nhun-eo-al110', 'D', '310000.00', '0.00', NULL, 0, NULL, NULL, '&Aacute;o được may bằng chất ren cao cấp, mẫu m&atilde; đẹp, sử dụng bền l&acirc;u! form su&ocirc;ng d&agrave;i nh&uacute;n eo gi&uacute;p người mặc c&agrave;ng th&ecirc;m thanh lịch v&agrave; duy&ecirc;n d&aacute;ng.&nbsp;<br />\r\nNgo&agrave;i việc sử dụng l&agrave;m &aacute;o che ngo&agrave;i khi đi biển, c&ograve;n c&oacute; thể sử dụng l&agrave;m &aacute;o thời trang, phối &aacute;o thun ba lỗ b&ecirc;n trong,&nbsp; hoặc &aacute;o bra với quần jin cạp cao đảm bảo bạn sẽ rất xinh trong mắt mọi người !<br />\r\nChất liệu : Ren cao cấp, mẫu m&atilde; đẹp, sử dụng bền l&acirc;u<br />\r\nXuất xứ : Th&aacute;i Lan', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
(1138, 0, NULL, 'N', 'AL67', 'Áo choàng đi biển form suông rộng AL67', NULL, 'ao-choang-di-bien-form-suong-rong-al67', 'A', '260000.00', '0.00', NULL, 0, NULL, NULL, '<p>Những chiếc áo lưới sẽ khiến cho bộ bikini của bạn thêm phần duyên dáng và thu hút hơn. Áo choàng đi biển voan somi trắng dài AL67 được may bằng chất liệu voan ren cao cấp nhập khẩu, góp phần tạo nên nét duyên cho các cô nàng yêu thích phong cách bánh bèo nữ tính<br />Chất liệu : Ren cao cấp, mẫu mã đẹp, sử dụng bền lâu<br />Xuất xứ : Thái Lan</p>', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
(1139, 0, NULL, 'N', 'BKN559', 'Đôi bơi xương cá cạp cao BKN559', NULL, 'doi-boi-xuong-ca-cap-cao-bkn559', 'D', '320000.00', '0.00', NULL, 0, NULL, NULL, 'Đồ bơi hai mảnh BKN559 &Aacute;o c&oacute; m&uacute;t ngực d&agrave;y dặn, frorm croptop&nbsp; dạng b&egrave;o nh&uacute;n đan d&acirc;y kiểu sương c&aacute; sau lưng trẻ trung năng động.<br />\r\nQuần cạp cao che tối đa khuyết điểm v&ograve;ng 2 , tăng phần gợi cảm cho người mặc, vừa sexy vừa k&iacute;n đ&aacute;o<br />\r\nChất liệu : Thun lạnh, co d&atilde;n 4 chiều, d&agrave;y dặn, mịn, m&aacute;t, kh&ocirc;ng h&uacute;t nước được nhập khẩu từ H&agrave;n Quốc<br />\r\nXuất xứ : Made in Việt Nam<br />\r\nCam kết : Kh&ocirc;ng ra m&agrave;u, kh&ocirc;ng mất form sau khi mặc.<br />\r\nTo&agrave;n bộ đồ bơi của evashopping được may bằng chất thun bơi cao cấp, d&agrave;y dặn, tỉ mỉ từng đương kim mũi chỉ.​', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
(1140, 0, NULL, 'N', 'AL90', 'Áo khoác đi biển sơmi voan trắng dài AL90', NULL, 'ao-khoac-di-bien-somi-voan-trang-dai-al90', 'D', '320000.00', '0.00', NULL, 0, NULL, NULL, '<p>Những chiếc áo lưới sẽ khiến cho bộ bikini của bạn thêm phần duyên dáng và thu hút hơn. Áo choàng đi biển voan somi trắng dài AL90 được may bằng chất liệu voan cao cấp nhập khẩu, góp phần tạo nên nét duyên cho các cô nàng yêu thích phong cách bánh bèo nữ tính<br />Chất liệu : Ren cao cấp, mẫu mã đẹp, sử dụng bền lâu<br />Xuất xứ : Thái Lan</p>', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL),
